description:
Necrosis (2009)  

Verenigde Staten
Horror / Thriller
90 minuten

geregisseerd door Jason Robert Stephens
met James Kyson Lee, George Stults en Penny Drake

Zes vrienden vertrekken naar een afgelegen blokhut om daar in de sneeuw vakantie te vieren. Maar dan worden de zes vrienden geconfronteerd met een grote sneeuwstorm, die ervoor zorgt dat het zestal niet meer uit het huisje kan komen. Ze zitten opgesloten en het duurt niet lang voordat ze worden lastig gevallen door een paar angstaanjangende geesten.

